import React, {Component} from 'react';

class Details extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="data-in-page">
                <p>Hello {this.props.typ} with {this.props.id} </p>
            </div>
        );
    }
}

export default Details;
